import React from "react";
import styles from "./Navbar.module.css";

const Navbar = props => {
  return (
    <div>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
        <li>4</li>
        <li>5</li>
      </ul>
    </div>
  );
};

export default Navbar;
